INSERT INTO `product` (`product_id`, `product_date`, `shop_id`, `product_avatar`, `product_quantity`, `product_view`, `product_price`, `product_sale`, `product_title`, `product_image`, `product_description`, `last_update`, `status`) VALUES
(1, '2021-11-09 16:31:56', 1, '1', NULL, 1, 10900, 0, 'Quần lót nữ đúc su thun lạnh cạp ép không viền cao cấp QL16', '2,3', 'Giúp bảo vệ vùng kín của nàng không bị tổn thương từ các trang phục bên ngoài (như dây kéo của quần, quần jean, quần bó sát,…) hoặc vô tình bị cọ sát mỗi khi vận động. - Ngoài ra quần lót còn giúp giữ cho vùng kín luôn được khô thoáng, sạch sẽ. Đồng thời nó còn làm giảm sự xâm nhập của những vi khuẩn một cách hiệu quả. - Không những thế chiếc quần lót còn giúp chị em chắn kỹ lưỡng. Nàng sẽ tránh được những tình huống lộ, hàng, hớ hênh khi mặc quần ngắn, váy ngắn. - Mặt khác sản phẩm này còn có khả năng che đi các khuyết điểm của vòng ba.', 0, 1),
(2, '2021-11-09 16:32:52', 1, '4', NULL, 1, 2500, 0, 'Quần Lót Nữ Cotton Y Tế Thời Trang Cho Nữ QL03', '5,6', 'Giúp bảo vệ vùng kín của nàng không bị tổn thương từ các trang phục bên ngoài (như dây kéo của quần, quần jean, quần bó sát,…) hoặc vô tình bị cọ sát mỗi khi vận động. - Ngoài ra quần lót còn giúp giữ cho vùng kín luôn được khô thoáng, sạch sẽ. Đồng thời nó còn làm giảm sự xâm nhập của những vi khuẩn một cách hiệu quả. - Không những thế chiếc quần lót còn giúp chị em chắn kỹ lưỡng. Nàng sẽ tránh được những tình huống lộ, hàng, hớ hênh khi mặc quần ngắn, váy ngắn. - Mặt khác sản phẩm này còn có khả năng che đi các khuyết điểm của vòng ba.', 0, 1),
(3, '2021-11-09 16:32:52', 1, '7', NULL, 0, 10900, 0, 'Quần lót nữ thun lạnh đúc su không đường may mặc trong váy dễ thương QL01', '8,9', 'Giúp bảo vệ vùng kín của nàng không bị tổn thương từ các trang phục bên ngoài (như dây kéo của quần, quần jean, quần bó sát,…) hoặc vô tình bị cọ sát mỗi khi vận động. - Ngoài ra quần lót còn giúp giữ cho vùng kín luôn được khô thoáng, sạch sẽ. Đồng thời nó còn làm giảm sự xâm nhập của những vi khuẩn một cách hiệu quả. - Không những thế chiếc quần lót còn giúp chị em chắn kỹ lưỡng. Nàng sẽ tránh được những tình huống lộ, hàng, hớ hênh khi mặc quần ngắn, váy ngắn. - Mặt khác sản phẩm này còn có khả năng che đi các khuyết điểm của vòng ba.', 0, 1),
(4, '2021-11-09 16:32:52', 1, '10', NULL, 0, 159000, 0, 'Quần Lót Nữ Cotton Viền Ren dễ thương QL05', '11,12', 'Mỗi khi mua quần áo, đầm váy thì phải chọn theo ký hiệu size của nhà sản xuất cung cấp, để giúp khách hàng dễ dàng chọn được sản phẩm phù hợp với vóc dáng của mình. Vậy các ký hiệu size XS,S,M,L,XL,XXL mang ý nghĩa gì? Dưới dây là ý nghĩa của size quần áo để giúp bạn dễ nhớ và phân biêt. XS = Extra Small = Rất nhỏ S = Small = Nhỏ M = Medium = Trung bình L = Large = Lớn XL = Extra Large = Rất lớn XXL = Extra Extra Large = Rất rất lớn', 0, 1),
