(6, '2021-11-09 16:32:52', 1, '16', NULL, 0, 189000, 0, 'SIÊU HOT - Quần legging đùi siêu hot', '17,18', 'Mỗi khi mua quần áo, đầm váy thì phải chọn theo ký hiệu size của nhà sản xuất cung cấp, để giúp khách hàng dễ dàng chọn được sản phẩm phù hợp với vóc dáng của mình. Vậy các ký hiệu size XS,S,M,L,XL,XXL mang ý nghĩa gì? Dưới dây là ý nghĩa của size quần áo để giúp bạn dễ nhớ và phân biêt. XS = Extra Small = Rất nhỏ S = Small = Nhỏ M = Medium = Trung bình L = Large = Lớn XL = Extra Large = Rất lớn XXL = Extra Extra Large = Rất rất lớn', 0, 1),
