(10, '2021-11-09 16:32:52', 1, '28', NULL, 1, 55000, 0, 'Quần legging nữ xuất hàn 💕Bigsize💕', '29,30', 'Không quần nữ nào cũng may chính xác theo số đo quy ước, các bạn đừng cứng nhắc quá khi cứ mua quần áo đúng size của mình thường mặc mà cần phải tìm hiểu thêm về số đo bên nhà cung cấp để chọn size. Tốt nhất bạn nên thử trực tiếp, còn không thì tham khảo bảng size bên nhà cung cấp hoặc nhờ người bán tư vấn thêm về cách chọn size. Hầu hết các bảng size chỉ chỉ mang tính chất tham khảo, bởi vì rất nhiều vóc dáng người mặc nhưng size quần áo chỉ có một. Về cơ bản khi mua quần áo cho nữ thường căn cứ theo chiều cao và cân nặng, nếu như bạn muốn chọn size chính xác hơn thì có thể chọn theo số đo 3 vòng cơ thể. Tùy vào chất liệu vải là form quần áo mà ta nên chọn size nhỏ hơn bằng hoặc lớn hơn size của mình một chút. Ví dụ: quần jean thường bị giãn sau lần giặt đầu tiên nên khi chọn size quần jean nữ nên chọn bằng hoặc hơi ôm một chút.', 0, 1),
